import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
  return (
    <div className="menu">
      {/* LEFT LOGO */}
      <div className="menu-left">
        <img src="/logo.png" alt="Zerodha" className="logo" />
      </div>

      {/* RIGHT MENU */}
      <div className="menu-right">
        <NavLink to="/" className="menu-item">Dashboard</NavLink>
        <NavLink to="/orders" className="menu-item">Orders</NavLink>
        <NavLink to="/holdings" className="menu-item">Holdings</NavLink>
        <NavLink to="/funds" className="menu-item">Funds</NavLink>
        <NavLink to="/apps" className="menu-item">Apps</NavLink>

        <div className="profile">
          <span>ZU</span>
        </div>
      </div>
    </div>
  );
};

export default Menu;
